import React from 'react';

function Project(props) {
    const {
        projects = []
    } = props;

    return (
        <div>
            {projects.map((project) => (
                <div>
                    <img alt='' key={project.name}/>
                    <h3 key={project.name}>{project.name}</h3>
                    <p key={project.name}>{project.description}</p>
                </div>
            ))}
        </div>
    )
}

export default Project;
